import "./dashboard.css";
import { auth } from "../../Firebase/firebaseConfig";



const Dashboard = (UserData, SetIsAuth) =>{
    return(
        <div className="dashboard">
            <img src={UserData.photoURL}></img>
        </div>
    )
}

export default Dashboard;
